//import logo from './logo.svg';
import './App.css';
import { People } from './people.js';
import './index.css';

function App() {
	return (
		<div className='bday-box'>
			<h1 className='app-title'>Birthday Reminder App</h1>
			<Birthdays />
		</div>
	);
}

const Birthdays = () => {
	return (
    People.filter((birthdate) => People.birthday === Date)
  )
};

export default App;
